import React from 'react';

const Popular = ({ click,setClick }) => {

    return(
        <div className="popular-element" onClick={() => setClick(false)}>
            <ul>
                <li>POPULAR</li>
                <li>NEW & NOTEWORTHY</li>
                <li>GOOD FOR SALE</li>
            </ul>
        </div>
    )

}

export default Popular
